import react from "react";
import { Card } from "antd";

function TestCard() {
  return (
    <Card
      headStyle={{ color: "white", background: "#3E3D40" }}
      title={
        <div>
          <b>SSID: </b>Aegis Research
        </div>
      }
      style={{
        width: 300,
        borderRadius: "5px",
        borderColor: "black",
        overflow: "hidden",
        color: "white",
        margin: "0",
      }}
      bodyStyle={{ background: "#1F1E26" }}
    >
      <p>Card content</p>
      <p>Card content</p>
      <p>Card content</p>
      <p>Card content</p>
    </Card>
  );
}

export default TestCard;
